void writePause(int version)
{
	for(int i = 0; i < resumeScreen.height; i++)
	{
		for(int j = 0; j < resumeScreen.width; j++)
		{
			switch (version)
			{
				case 2:
				if(resumeScreen.image_pixels[(i*resumeScreen.width+j)*4] == 0)
				{
					writeBit(CENTERX*SIZE + j*SIZE, CENTERY*SIZE + i*SIZE, 0);
				}
				else
				{
					writeBit(CENTERX*SIZE + j*SIZE, CENTERY*SIZE + i*SIZE, 1);
				}
				break;
				case 1:
				if(newGameScreen.image_pixels[(i*newGameScreen.width+j)*4] == 0)
				{
					writeBit(CENTERX*SIZE + j*SIZE, CENTERY*SIZE + i*SIZE, 0);
				}
				else
				{
					writeBit(CENTERX*SIZE + j*SIZE, CENTERY*SIZE + i*SIZE, 1);
				}
				break;
				case 0:
				if(quitScreen.image_pixels[(i*quitScreen.width+j)*4] == 0)
				{
					writeBit(CENTERX*SIZE + j*SIZE, CENTERY*SIZE + i*SIZE, 0);
				}
				else
				{
					writeBit(CENTERX*SIZE + j*SIZE, CENTERY*SIZE + i*SIZE, 1);
				}
				break;
			}
		}
	}
}
